def skew(g, imin, imax):
    '''For a sequence g, and a window beginning at imin and ending at imax, 
    finds the difference in # of G and C bases for each index as you progress 
    through the sequence. Returns a sequence of skew values.
    '''
    skewval = [0]
    d = {}
    d['C'] = 0
    d['G'] = 0
    for i in np.arange(imin, imax):
        nuc = g[i]
        if nuc == 'C':
            d['C'] = d['C'] + 1
        if nuc == 'G':
            d['G'] = d['G'] + 1
        skewval.append(d['G'] - d['C'])

    return(skewval)

